START TRANSACTION;
DROP TABLE IF EXISTS solmut;
DROP TABLE IF EXISTS sensorit;
DROP TABLE IF EXISTS mittaukset;
DROP TABLE IF EXISTS kayttajat;

CREATE TABLE kayttajat (
    kayttajan_id INTEGER NOT NULL PRIMARY KEY AUTO_INCREMENT,
    tunnus VARCHAR(128) NOT NULL,
    salasana VARCHAR(128) NOT NULL
);

CREATE TABLE solmut (
   solmun_id     INTEGER  NOT NULL PRIMARY KEY, 
   solmun_nimi   VARCHAR(128) NOT NULL,
   sensorit  VARCHAR(4096) default '[]',
   solmun_sijoituspaikka VARCHAR(128) NOT NULL
);


CREATE TABLE sensorit(
   sensorin_id        INTEGER  NOT NULL PRIMARY KEY,
   sensorin_nimi      VARCHAR(16) NOT NULL,
   solmun_id     INTEGER NOT NULL,
   mitattava_suure  VARCHAR(2048)  DEFAULT '[]'
);


CREATE TABLE mittaukset(
   mittauksen_id       INTEGER NOT NULL PRIMARY KEY AUTO_INCREMENT,
   mittauksen_datetime    DATETIME  NOT NULL,
   sensorin_id    INTEGER  NOT NULL,
   mitattava_suure VARCHAR(16) NOT NULL,
   tulos INTEGER NOT NULL
);


COMMIT;
